import logo from './logo.svg';
import './App.css';
import {TeamPage} from './pages/TeamPage';
import {MatchPage} from './pages/MatchPage';

function App() {
  return (
    <div className="App">
      <h1>IPL Dashboard</h1>
      <TeamPage/>
      <MatchPage/>
    </div>
  );
}

export default App;
